import "./Fill.css";
import React from "react";
import Tap from "../../img/ic-tap.png";

const Fill = () => {
  return (
    <div className="Fill">
      <div className="Fill-lang-background">
        <div className="Fill-top-text">
          Please place bottle under the blinking button & press it to start
          refilling
          <div className="Fill-tap">
            <img src={Tap} alt="" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Fill;
